import Head from 'next/head';
import styled from 'styled-components';
import styles from '../utils/styles';

const TuViejaStyled = styled.g`
    fill-opacity: 0.5;
    stroke-miterlimit: 0;
`;

class index extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
    }

    render() {
        return (
            <>
                <Head>
                    <meta charSet="utf-8" />
                    <meta
                        name="viewport"
                        content={
                            'user-scalable=0, initial-scale=1, ' +
                            'minimum-scale=1, width=device-width, height=device-height'
                        }
                    />
                    <meta property="og:site_name" content="Atharot" />
                    <meta name="apple-mobile-web-app-capable" content="yes" />
                    <meta name="apple-mobile-web-app-title" content="Atharot" />
                    <meta name="application-name" content="Atharot" />
                    <meta name="msapplication-TileColor" content="#FFFFFF" />
                    <script src="https://aframe.io/releases/0.9.2/aframe.min.js"></script>
                    <title>Atharot</title>
                </Head>
                <body
                    style={{
                        backgroundColor: '#000',
                        padding: 0,
                        margin: 0
                    }}
                >
                    <h1 style={{color: '#fff'}} className={styles.opacidad}>
                        Hola...(someone is typing)
                    </h1>

                    <div style={{margin: 'auto'}}>
                        <svg viewBox="-130 -20 300 100">
                            <TuViejaStyled id="cube">
                                <rect
                                    width="21"
                                    height="24"
                                    fill="#00affa"
                                    stroke="#0079ad"
                                    transform="skewY(30)"
                                />
                                <rect
                                    width="21"
                                    height="24"
                                    fill="#008bc7"
                                    stroke="#0079ad"
                                    transform="skewY(-30) translate(21 24.3)"
                                />
                                <rect
                                    width="21"
                                    height="21"
                                    fill="#009CDE"
                                    stroke="#0079ad"
                                    transform="scale(1.41,.81) rotate(45) translate(0 -21)"
                                />
                            </TuViejaStyled>
                        </svg>
                    </div>
                </body>
            </>
        );
    }
}
export default index;
